const NEW_ACTION = 'NEW_ACTION';
const ADD_ELEMENT = 'ADD_ELEMENT';


const  newAction = (state) => ({ type: NEW_ACTION, state });

const addAssignment = (value) => ({ type: ADD_ELEMENT, value });

export { newAction, addAssignment };
